import React from 'react';

class GetRequest extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            code: null 
        };
    }

    componentDidMount() {
        // Simple GET request using fetch
        fetch('https///localhost:8080/docker')
            .then(response => response.json())
            .then((result) => this.setState({code : result.name}));
    }

    render() {
        return (
            <div>
                {this.state.code}
            </div>
        );
    }
}

export default GetRequest;
